async (
  context: GetStaticPathsContext,
  basePaths: { projectRelativeBasePath: string; queryPath: string }[]
): Promise<GetStaticPathsResult> => {
  const paths: string[] | undefined = (await docsGetPages(basePaths)).map(
    (x) => x.queryPath
  );

  // console.log({ paths });
  if (!paths) {
    return { paths: [], fallback: "blocking" };
  }

  const staticPaths = paths
    .filter((x) => x !== "")
    .map((p) => ({ params: { paths: p.split("/") } }));

  return {
    paths: staticPaths,
    fallback: "blocking",
  };
}
